export class Point {
    constructor(x, y, z) {
      this.x = x;
      this.y = y;
      this.z = z;
    }

    getArray() {
      return [this.x, this.y, this.z];
    }

    getMatrix() {
      return [[this.x], [this.y], [this.z]];
    }

    getMatrix4() {
      return [[this.x], [this.y], [this.z], [1]];
    }
}

export function createPoint(arr) {
  return new Point(arr[0][0], arr[1][0], arr[2][0]);
}
